import React from 'react';
import { Diff } from 'react-diff-view';
import 'react-diff-view/style/index.css';

const CodeDiffViewer = ({ oldCode, newCode }) => {
  // Assuming oldCode and newCode are passed as props
  return (
    <div>
      <h2>Code Differences</h2>
      <Diff
        viewType="split"
        oldValue={oldCode}
        newValue={newCode}
        splitView={true}
        highlightLines={true}
        hideLineNumbers={false}
        showDiffOnly={false}
      />
    </div>
  );
};

const App = () => {
  // Define your oldCode and newCode here or fetch them from wherever needed
  const oldCode = `
    function MyComponent() {
      return <div>Hello, old world!</div>;
    }
  `;

  const newCode = `
    function MyComponent() {
      return <div>Hello, new world!</div>;
    }
  `;

  return <CodeDiffViewer oldCode={oldCode} newCode={newCode} />;
};

export default App;
